<?phpnamespace App;use Illuminate\Database\Eloquent\Model;use Illuminate\Database\Eloquent\Relations\HasMany;use Illuminate\Database\Eloquent\SoftDeletes;class Cycle extends Model{    use SoftDeletes;    /**     * @var string     */    protected $table = 'cycles';    /**     * @var string[]     */    protected $fillable = [        'name',        'code',    ];    /**     * @return HasMany     */    public function students(): HasMany    {        return $this->hasMany(Student::class);    }}